import React from 'react'

class TodoList extends React.Component {
  onClick = id => {
    this.props.onComplete(id)
  }
  render() {
    return (
      <ul>
        {this.props.todoList.map((todo, id) => (
          <li key={id}>
            {todo.text}
            <button onClick={this.onClick(id)}>{todo.completed ? '✓' : ' '}</button>
          </li>
        ))}
      </ul>
    )
  }
}
export default TodoList
